			//全角数字での入力を半角に強制変換
			function after_tohankaku() {
				if (!options.tohankaku)
					return;
				$('input[type="text"]').change(function(e) {
					$(this).val( toHankaku($(this).val()) );
				});
			}
			function toHankaku(str) {
				str = str.replace(/[０-９]/g, function(str) {
					return String.fromCharCode(str.charCodeAt(0) - 65248);
				});
				str = str.replace(/[ー|－](\d+)/g, '-$1');
				str = str.replace(/[：]/g, ':');
				return str;
			}

			//ログイン・タイムアウトのカウントダウン
			function timeout_countdown() {
				if ( !options.timeout_countdown )
					return;
				var totime = 0;
				var sec = 0;
				if (localStorage.getItem(OPTION_PREFIX + 'starttime') !== null) {
					totime = (parseInt(localStorage.getItem(OPTION_PREFIX + 'starttime'), 10) + 3 * 60 * 60);
					sec = totime - getUnixTime();
				}
				//console.log(totime);
				if (sec < 0)
					sec = 0;
				var timeText = formatTime(sec);
				var dayText = caddDate2(new Date(), timeText);
				
			if( options.countdown_mod == '0') {
				var str = '<div id="ixamoko_sessout">セッションタイムアウトまで <span todo="d30m" totime="' + totime + '" class="ixamoko_countdown">' + timeText + '</span></div>';
				$('#lordSiteArea').hide();
				$('#lordNameBox').append( str );
				
				style('#ixamoko_sessout { background: black; color: white; padding: 4px 0; margin: 4px 2px 0 2px; text-align: center; font-family: MS PMincho; font-size: 12px; }' +
					 '#ixamoko_sessout span { font-family: Verdana; font-weight: bold; }'
				);
			}
			else {
				var str = '<div id="ixamoko_sessout">タイムアウトまで<br />残り <span todo="d30m" totime="' + totime + '" class="ixamoko_countdown">' + timeText + '</span></div>';
				$('table.stateTable').after( str );
				
				style('#ixamoko_sessout { cursor: pointer; margin-top: 3px; text-align: center; color: white; font-family: Verdana; font-size: 11px; }' +
					 '#ixamoko_sessout span { font-family: Verdana; font-weight: bold; }'
				);
				
				$('#ixamoko_sessout').click( function() {
					if ( confirm('ログアウトしますか？') ) {
						location.href = $('li.navi01_01 > a').attr('href');
					}
				});
			}
			
				var countdownTimer = null;
				var countDown = function(nowdate) {
					if (countdownTimer !== null)
						clearTimeout(countdownTimer);
					$('span.ixamoko_countdown').each(function() {
						var totime = parseInt($(this).attr('totime'), 10);
						var todo = $(this).attr('todo');
						var sec = totime - getUnixTime();
						if (sec < 0)
							sec = 0;
						var timeText = formatTime(sec);
						$(this).html(timeText);
						//残り時間によるテキストの色変更
						if (sec < 600) {
							if( options.countdown_mod == '0') {
								$('#ixamoko_sessout').css({'background-color':'crimson','color':''});
							} else {
								$('#ixamoko_sessout').css('color', 'red');
							}
						} else if (sec < 1800) {
							$('#ixamoko_sessout').css('color', 'yellow');
						}
					});
					countdownTimer = setTimeout(function() {
						countDown(new Date());
					}, 1000 - new Date().getMilliseconds());
				};
				countDown(new Date());
			}
			//タイムアウトのカウント用
			function caddDate2(baseDate, timetxt) {
				var tim = timetxt.match(/^(\d+):(\d+):(\d+)/);
				if (!tim)
				return "";
				var dt = new Date(baseDate.getFullYear(),
				baseDate.getMonth(),
				baseDate.getDate(),
				baseDate.getHours() + parseInt(tim[1], 10),
				baseDate.getMinutes() + parseInt(tim[2], 10),
				baseDate.getSeconds() + parseInt(tim[3], 10));
				
				return (dt.getHours() + 100).toString().substr(-2) + ":" +
				(dt.getMinutes() + 100).toString().substr(-2) + ":" +
				(dt.getSeconds() + 100).toString().substr(-2);
			}

