			//攻撃目標をマーク表示
			function panelAttack() {
				if (!options.panelAttack)
					return;
				if (location.pathname != "/map.php")
					return;
				if (options.map_butai_status) {
					$('#map_butai_data').find('tr').find('div.time_loc > a').each( function() {
					var fs = $(this).closest('tr').find('div.fstatus');
					var ahref = $(this).attr('href');
						var img, href, return_img;
							if (options.return_mode == '0') { return_img = IMAGES.panel_return; }
							else { return_img = IMAGES.icon_return; }
						switch( fs.text() ){
							case '待機' : img = IMAGES.panel_mode_wait, href = ahref; break;
							case '加待' : img = IMAGES.panel_backup_wait, href = ahref; break;
							case '帰還' : img = return_img, href = ahref; break;
							case '合流' : img = IMAGES.panel_meeting, href = ahref; break;
							case '加勢' : img = IMAGES.panel_backup, href = ahref; break;
							case '開拓' : img = IMAGES.panel_development, href = ahref; break;
							case '国移' : img = IMAGES.panel_mode_move, href = ahref; break;
							case '攻撃' : img = IMAGES.panel_attack, href = ahref; break;
							case '陣張' : img = IMAGES.panel_jinbari, href = ahref; break;
						}
							href = href.replace('../', '/');
							distinction( href, img );
					});
				}
				else {
					$.post( '/facility/unit_status.php?dmo=all',
						function(html) {
							$(html).find('div.ig_fight_statusarea').find('tr.noborder:eq(0)').find('td:eq(1)')
							.each(function() {
								if( $(this).find('img').length ) {
									var src, href, img, search, mode, word;
										src = $(this).find('img').attr('src');
										search = $(this).closest('tbody').find('td.td_bggray:eq(1)').find('a:eq(0)').attr('href');
										mode = $(this).closest('tbody').find('td:eq(2)').text();
										word = $(this).find('a').text();
									
									if ( src.indexOf('mode_wait.png') != -1) {
										img = IMAGES.panel_mode_wait; href = search;
									}
									if ( src.indexOf('mode_return.png') != -1) {
										if ( options.return_mode == '0' ) {
											img = IMAGES.panel_return; href = search;
										}
										else {
											img = IMAGES.icon_return; href = search;
										}
									}
									if ( src.indexOf('mode_meeting.png') != -1) {
										img = IMAGES.panel_meeting; href = search;
									}
									if ( src.indexOf('icon_backup.png') != -1) {
										img = IMAGES.panel_backup; href = search;
									}
									if ( src.indexOf('mode_develop.png') != -1) {
										img = IMAGES.panel_development; href = search;
									}
									if ( src.indexOf('mode_move.png') != -1) {
										img = IMAGES.panel_mode_move; href = search;
									}
									if ( src.indexOf('icon_dungeon.png') != -1) {
										return true;
									}
									if ( src.indexOf('mode_attack.png') != -1) {
										if(  mode == '-' ) {
											img = IMAGES.panel_jinbari; href = search;
										}
										else {
											img = IMAGES.panel_attack; href = search;
										}
									}
								}
								else {
									if ( word == '帰還する' ) {
										img = IMAGES.panel_backup_wait; href = search;
									}
								}
								href = href.replace('../land', '/map');
								distinction( href, img );
							});
						}
					);
				}
			}
			
