			//合戦報告書：ナビを追加
			function war_detail_navi() {
				
				if (location.pathname == "/report/detail.php") {
					var href = $('img[src$="btn_back.gif"]').parent().attr('href');
					$('<div id="detail_navi"><div id="returnA"><a href="' + href + '">戻る</a></div></div>')
					.insertBefore('table.commontable:eq(0)');
				}
				if (location.pathname == "/war/detail.php") {
					var href = $('img[src$="btn_return.png"]').parent().attr('href');
					$('<div id="detail_navi"><div id="returnA"><a href="' + href + '">戻る</a></div></div>')
					.insertBefore('table.ig_battle_table');
				}
				
				if (location.pathname == "/message/detail.php") {
					var href = $('img[src$="btn_back.gif"]').parent().attr('href');
					$('<div id="detail_navi"><div id="returnA"><a href="' + href + '">戻る</a></div></div>')
					.insertAfter('div.message_footernavi:eq(0)');
				}
				
				if (location.pathname != "/war/detail.php")
					return;
				var target_query = location.search.substr(1, location.search.length - 1).split("&");
				target_query = target_query[0];
				var back_query = $('a[href^="list.php"]').attr('href');
				
				//変換[+]対処
				var plane = 'list.php?m=&p=&s=&name=&word=&coord=&x=&y=&t=';
				
				if( back_query != plane ) {
					
					if( back_query.indexOf(' ') != -1 ) {
						back_query = back_query.replace( ' ', encodeURIComponent('+') );
					}
					
					var return_href = $('a[href^="list.php?m="]').attr('href');
					if( return_href.indexOf(' ') != -1 ) {
						return_href = return_href.replace( ' ', encodeURIComponent('+') );
						$('a[href^="list.php?m="]').attr('href', return_href );
					}
					
				}
				
				$.post(
					'/war/' + back_query,
					function(html) {
						var before_query = '';
						var after_query = '';
						var target_row = 0;
						var i = 0;
						var max_row = 0;
						$(html).find('a[href^="detail.php"]').each(function() {
							if ($(this).attr('href').indexOf(target_query) >= 0) {
								target_row = i;
							}
							i++;
							max_row++;
						});
						i = 0;
						$(html).find('a[href^="detail.php"]').each(function() {
							if ((i == target_row - 1) && (target_row !== 0)) {
								after_query = $(this).attr('href');
							}
							if ((i == target_row + 1) && (target_row != max_row)) {
								before_query = $(this).attr('href');
								return false;
							}
							i++;
						});
						war_detail_navi_link(html, before_query, after_query);
						return;
					}
				);
			}

			function war_detail_navi_link(argHtml, before_query, after_query) {
				var target_href = '';
				var t_num = $(argHtml).find('.ig_battle_pagelist').find('span:eq(0)').text();
				if (before_query === '') {
					if (t_num !== '') {
						t_num++;
						$(argHtml).find('.ig_battle_pagelist').find('a[href^="/war/list.php"]').each(function() {
							if ($(this).text() == t_num) {
								target_href = $(this).attr('href');
								return false;
							}
						});
					}
				} else if (after_query === '') {
					if (t_num !== '') {
						t_num--;
						$(argHtml).find('.ig_battle_pagelist').find('a[href^="/war/list.php"]').each(function() {
							if ($(this).text() == t_num) {
								target_href = $(this).attr('href');
								return false;
							}
						});
					}
				} else {
					make_navi(before_query, after_query);
					return;
				}
				if (target_href !== '') {
					$.post(
						target_href,
						function(html) {
							if (before_query === '') {
								$(html).find('a[href^="detail.php"]').each(function() {
									before_query = $(this).attr('href');
									return false;
								});
							}
							if (after_query === '') {
								$(html).find('a[href^="detail.php"]').each(function() {
									after_query = $(this).attr('href');
								});
							}
							make_navi(before_query, after_query);
							return;
						}
					);
				} else {
					make_navi(before_query, after_query);
					return;
				}
			}

			function make_navi(before_query, after_query) {
				var a_query_page = after_query.substr(1, location.search.length - 1).split("&");
				a_query_page = a_query_page[2];
				if ((a_query_page === undefined) || (a_query_page == 'p=0'))
					after_query = '';
				var tmp = '<div class="report_navi clearfix">';
				if (before_query === '') {
					tmp += '<div class="leftG"></div>';
				} else {
					tmp += '<div class="leftF"><a href="' + before_query + '">前の報告書へ</a></div>';
				}
				if (after_query === '') {
					tmp += '<div class="rightG"></div>';
				} else {
					tmp += '<div class="rightF"><a href="' + after_query + '">次の報告書へ</a></div>';
				}
					tmp += '</div>';
				
				$('#detail_navi').append( tmp );
				keybind( before_query , after_query );
			}

