				var Loading = $('#nowLoadingContent'),
					maskHeight = $(document).height(),
					winH = $(window).height(),
					winW = $(window).width();
				
				$('#loading_mask').css( 'height', maskHeight ).show();
				
				Loading.css( 'top', winH / 2 - ( (Loading.height() / 2) + 120) )
					  .css( 'left', winW / 2 - ( Loading.width() / 2) ).show();
