			//次ページ追加モード
			function quick_add_card() {
				if (location.pathname != "/card/deck.php")
					return;
				if ( !options.quick_add_card )
					return;
				if( !$('ul.pager.cardstock').length )
					return;
				var page =  parseInt(  $('#p').val() ) +1;
				$('div.maisuu')
				.append('<span class="addpage" style="color:lime; margin-left: 5px;">▼</span>')
				.attr('next_page', page).css({'cursor':'pointer', 'left':'208px'});
				$('div.maisuu').live('click',  function() {
					var select_assign_no = $('#select_assign_no').val(),
						select_card_group = $('#select_card_group').val(),
						p = $('div.maisuu').attr('next_page');
						
					var max_page;
					if (options.pager_ajax) {
						max_page = $('ul.pager.cardstock:eq(0)').find('a.ixamoko_deckpager:last').attr('page');
						max_page = parseInt( max_page );
					}
					else {
						max_page = $('ul.pager.cardstock:eq(0)').find('li:last').find('a:eq(1)').attr('onClick');
						max_page = max_page.substring(max_page.indexOf('"p"'), max_page.length);
						max_page = max_page.match(/".*?"/g);
						max_page = max_page[1].replace(/"/g, '');
						max_page = parseInt( max_page );
					}
					
					if( max_page < parseInt( $(this).attr('next_page')) ) {
						return false;
					}
					
					var data = {
							myselect: '',
							ano: select_assign_no,
							dmo: 'nomal',
							select_card_group: select_card_group,
							p: p
						};
					
					$.post('/card/deck.php', data,
						function(html) {
							var newpage =  parseInt( $(html).find('#p').val() ) + 1;
							var newsmallcardarea = $(html).find('div.ig_deck_smallcardarea');
							var newcardWindow = $(html).find('div[id^="cardWindow_"]');
							
							$('#ig_deck_smallcardarea_out').append( newsmallcardarea );
							$('#sidebar').before(newcardWindow);
							tb_init('a.thickbox');
							adding_check();
							deckGroupImgView();
							deck_soldier_set();
							union_deck_layout();
							
							var type = $('a.now_branch').text();
							var obj = $('div.ig_deck_smallcardarea');
							if( type != '') { soldier_filter( obj, type ); }
							
							$('#deck_file').find('#ig_decksection3').removeAttr('class');
							$('div.maisuu').removeAttr('next_page').attr('next_page', newpage);
							$('span.addpage').remove();
							$('div.maisuu').append( '<span class="addpage" style="color:lime; margin-left: 5px;">'+ $(html).find('#p').val() + '</span>' );
							
							if( max_page < parseInt($('div.maisuu').attr('next_page')) ) {
								moko_notice('全ページ読み込み完了');
								return false;
							}
						}
					);
					return false;
				});
			}
			
