				var panel = $('<div id="ixamoko-unitpower" />').append( tmpl );
				panel.prependTo( '#ig_decksection2' );
				
				$('#deck_skill_display').css('height', 'auto');
				$('div.deck_skill_display_data').css({'min-height':'59px', 'margin-height':'59px'});
