			//施設建築
			function openTool(target, x, y) {
				$('#tooltip_layer').css({left: x - 50, top: y - 50, 'padding':'50px 50px'}).show();
				$('#tooltip_layer').mouseout(function() {
					$('#tooltip_layer').hide();
				});
				$('#tooltip_layer:children').mouseover(function() {
					$('#tooltip_layer').show();
				});
				$('#facilityUnit').text('').append('<div style="padding:2px 10px; opacity: 0.6;"><img src="' + IMAGES.wait + '" /></div>');
				var facilityName = $(target).attr('title');
				var shortage = $(target).attr('href').split('/')[1];
				
				$.post( '/' + $(target).attr('href'), function(html) {
					var Rebuilding = $(html).find('div.ig_tilesection_title').text();
					var Innermid;
					if( Rebuilding == '上位施設への建て替え') { 
						Innermid = $(html).find('div[class^="ig_tilesection_innermid"]:eq(0)');
					}
					else {
						Innermid = $(html).find('div[class^="ig_tilesection_innermid"]');
					}
					var unit_list = [];
					Innermid.each(function() {
						var unit = $(this).find('h3 > a').text();
						if ( unit !== '') {
							var btn = $(this).find('a[href^="build.php"]') || $(this).find('a[href^="rebuild.php"]');
							var url = btn.attr('href');
							var construction =  btn.find('img').attr('alt');
							var btnarea = $(this).find('div.ig_tilesection_btnarea_left');
							var len = btnarea.find('img').length;
							var shortage_txt = btnarea.text().match(/資源が不足しています/);
							var none_txt = btnarea.text().match(/これ以上、建設準備を追加できません/);
							var max_txt = btnarea.text().match(/最大レベルです/);
							
							if (!options.hide_facility || (options.hide_facility && unit !== '水田' && unit !== '機織り場' && unit !== '木工所' && unit !== 'たたら場')) {
								url = url.replace('&mode=cp', '');
								
								if ( construction == 'この施設を建設する') {
									unit_list.push({ mod: 'c', unit: unit, url: url, len: len, shortage_txt: shortage_txt, none_txt: none_txt, max_txt: max_txt });
								}
								else{
									unit_list.push({ mod: 'u',unit: unit,url: url, len: len, shortage_txt: shortage_txt, none_txt: none_txt, max_txt: max_txt });
								}
							}
						
						}
					});
					if (typeof unit_list === 'undefined' || typeof unit_list[0] === 'undefined') {
						$('#tooltip_layer').hide();
						return;
					} else {
						addUnit(unit_list, facilityName, shortage);
						return;
					}
				});
			}

			//施設建築Lvアップ
			function addUnit( unit_list, facilityName, shortage ) {
				$('#facilityUnit').text('').append('<div id="facility_selection_tile">' + facilityName + '</div>');
				var i, mod;
				function addUnit_loop(i) {
					if( unit_list[i].mod == 'c' ){
						mod = '建設';
					}
					if(unit_list[i].mod == 'u'){
						mod = 'LvUP';
					}
					if( unit_list[i].shortage_txt ){
						mod = '資源不足';
					}
					if( unit_list[i].none_txt ){
						mod = '建設追加不可';
					}
					if( unit_list[i].max_txt ){
						$('#facilityUnit').append('<li id="fUnit' + i + '" url="' + shortage + '">最大レベル</li>');
					}
					else {
						$('#facilityUnit').append('<li id="fUnit' + i + '" url="' + unit_list[i].url + '">[' + unit_list[i].unit + '] ' + mod + '</li>');
					}
					
					$('#facilityUnit').find('li:contains("資源不足"), li:contains("建設追加不可"), li:contains("最大レベル")').css('color', 'darkgray');
					
					$('#fUnit' + i).click(function(){
						$('#tooltip_layer').hide();
						if( unit_list[i].shortage_txt || unit_list[i].none_txt){
							location.href = "/facility/" + shortage;
						}
						else {
							location.href = "/facility/" + $(this).attr('url');
						}
					});
					
					if (options.facility_tool_WUP) {
						if( unit_list[i].max_txt || unit_list[i].shortage_txt || unit_list[i].none_txt ){
							return true;
						}
						if( unit_list[i].mod == 'c' ){
							mod = '[' + unit_list[i].unit + '] 建設+LvUP';
							$('#facilityUnit').append('<li id="fUnit_opt' + i + '" url="' + unit_list[i].url + '" mod="' + unit_list[i].mod + '">' + mod + '</li>');
						}
						else {
							mod = '[' + unit_list[i].unit + '] LvUP×2';
							$('#facilityUnit').append('<li id="fUnit_opt' + i + '" url="' + unit_list[i].url + '" mod="' + unit_list[i].mod + '">' + mod + '</li>');
						}
						
						$('#fUnit_opt' + i).click(function(){
							nowLoading();
							$('#tooltip_layer').hide();
							var unit_name = $(this).text().match(/\[.+?\]/)[0];
							if ( $(this).attr('mod') == 'c' ) {
								$.post('/facility/' + $(this).attr('url'), function(html) {
									//progress
									Info.title( unit_name + 'を建築中...');
									$.post('/facility/' + shortage, function(html) {
										var a = $(html).find('.ig_tilesection_btnarea_left').find('a');
										var href = a.eq(0).attr('href');
										if( a.length == 2 ){
											$.post( '/facility/' + href, function(html){
												//progress
												Info.title( unit_name + 'をLvUP中...');
												location.href = $(this).attr('url');
											});
										}
										else {
											var txt = $(html).find('.ig_tilesection_btnarea_left').text().replace($(html).find('.ig_tilesection_pay').text(),'').trim();
											$('#nowLoadingContent').hide();
											moko_alert('LvUPを実行できませんでした');
											setTimeout(function(){
												location.href = location.pathname;
											}, 1500);
										}
										
									});
								});
							}
							 else { 
								//progress
								Info.title( unit_name + 'をLvUP中...');
								$.post('/facility/' + $(this).attr('url'), function(html) {
									$.post('/facility/' + shortage, function(html) {
										var a = $(html).find('.ig_tilesection_btnarea_left').find('a');
										var href = a.eq(0).attr('href');
										if( a.length == 2 ){
											$.post( '/facility/' + href, function(html){
											//progress
											Info.title( unit_name + 'をLvUPx2中...');
												location.href = $(this).attr('url');
											});
										}
										else {
											var txt = $(html).find('.ig_tilesection_btnarea_left').text().replace($(html).find('.ig_tilesection_pay').text(),'').trim();
											$('#nowLoadingContent').hide();
											moko_alert('LvUPx2を実行できませんでした');
											setTimeout(function(){
												location.href = location.pathname;
											}, 1500);
										}
										
									});
										
								});
							}
						});
					}
				}
				for (i = 0; i < unit_list.length; i++)
					addUnit_loop(i);
			}

