			function ar_summary_sub( battle_reportinfos, target ) {
				var optionArray = [];
				target.find('tr').slice(1).each( function(){
					var $this = $(this);
					var rank = $this.find('td:eq(0)').text();
					if( rank == '筆頭' ){
						var rank = 1;
					}
					var member =$this.find('td:eq(3)').text();
					if( isNaN( rank ) )
						return;
					if ( rank <= 50 && member != 1 ) {
						optionArray.push({"url":$this.find('a[href*="/user/\?user_id="]').attr('href')});
						battle_reportinfos[$this.find('td:eq(1)').text()] = 'rank=' + rank + '&&member=' + member + '&&name=' + $this.find('td:eq(2)').text();
					}
				});
				var i = 0;
				for(key in optionArray){
					i++;
					break;
				}
				if (i > 0) {
					doOrderGuaranteedAjax(optionArray, function(){
					});
				}
				return battle_reportinfos;
				
				function doOrderGuaranteedAjax(ajaxOptionArray, allCompleteHandler){
					var defaults = {
						type: "POST",
						cache: false, 
						dataType: "text",
						async: false,
						success : function(html) {
								$(html).find('#ig_mainareaboxInner').find('.common_table1.center').find('td').each( function(){
									if($(this).text()=="本領"){
										var main_url = $(this).parent().find('td:eq(2)>a').attr("href");
											var alliance_name = $(html).find('#ig_mainareaboxInner').find('a[href*="/alliance/info.php\?id="]').text();
											var level = $(html).find('#ig_mainareaboxInner').find('.pro1').find('.para').text().match(/Lv\.(\d+)/);
											if (battle_reportinfos[alliance_name]!=undefined){
											var xy_x = main_url.match(/x=([-\d]+)/);
											var xy_y = main_url.match(/y=([-\d]+)/);
											var area;
											if(xy_y[1]<0){area="南";}else{area="北";}
											if(xy_x[1]<0){area+="西";}else{area+="東";}
											battle_reportinfos[alliance_name] = battle_reportinfos[alliance_name] + '&&area=' + area + '&&xy_x=' + xy_x[1] + '&&xy_y=' + xy_y[1] + '&&level=' + level[1];
											}
									}
								});
						},
						error: function (XMLHttpRequest, textStatus, errorThrown) {
						},
						complete : function(html) {
							ajaxOptionArray.shift();		// 最初の要素を削除
							if (ajaxOptionArray.length == 0 ) {		// すべての通信が完了した場合
								if (allCompleteHandler) {			// コールバックが設定された場合
									allCompleteHandler();
								}
							} else {			// 通信配列にまだ通信が残っている場合
								option = ajaxOptionArray[0];			// ajaxのオプションを次の通信に切り替え
								opts = $.extend({}, defaults, option);
								$.ajax(opts);			// 通信を開始
							};
						}
					};
					// 初期指定
					var option = ajaxOptionArray[0];
					var opts = $.extend({}, defaults, option);
					// 一回のみ実行
					$.ajax(opts);
				};
			}

			//白くじ
			function white_kuji() {
				if( location.pathname != "/senkuji/senkuji.php")
					return;
					var stock = $('p.l_cardstock').text().match(/\d+/g),
						stock = stock[1] - stock[0];
					var capa = 10;
						if( stock < capa  ) { capa = stock }
					
					if( capa == 0 ) { return; }
					
					$(document.body).append( '<div id="kuji_result" style="display:none;" />' );
					$('span.money_b_txt').html('銅銭　100　<a href="javascript:void(0);" class="white" style="color: greenyellow;">' + capa + '枚引き</a>');
					
					$('a.white').live('click', function() {
						if ( confirm('戦国くじ(白)を' + capa + '枚引いてよろしいですか？') ) {
							$('#kuji_result').children().remove();
							$('div.b_cm_text:eq(0)').empty();
							var data = 'send=send&got_type=0';
							for( var i = 0; i < capa; i++ ) {
								post_senkuji( data );
							}
						}
						return false;
					});
			}

			function post_senkuji( data ) {
				$.post('/senkuji/senkuji.php', data,
					function( x ) {
						var result = $(x).find('strong.red').eq(0);
						$('div.b_cm_text:eq(0)')
						.append('<div style="line-height: 1.4;"><span style="font-size: 12px; font-weight: bold;">' +result.text() + '</span> を引きました</div>');
					}
				);
			}

			//キーバインド
			function keybind( before_query , after_query ) {
				if ( !options.keybind )
					return;
				$(document).keydown(function(e) {
					var sp = $('ul.pager').find('li:has(span)');
					var sp_prev = sp.prev().find('a');
					var sp_next = sp.next().find('a');
					
					if ( e.target.tagName == 'INPUT' || e.target.tagName == 'TEXTAREA' )
					return;
					
						switch (e.keyCode) {
							// Key: m
							case 77: location.href = '/map.php';
							break;
							// Key: e
							case 69: location.href = '/facility/unit_status.php?dmo=enemy';
							break;
							// Key: t
							case 84: location.href = '/card/trade.php?t=name&k=&s=no&o=a';
							break;
							// Key: z
							case 90: location.href = '/facility/unit_status.php?dmo=all';
							break;

							// Key: Enter / T Enter
							case 13: $('img[src$="btn_again.jpg"]').click();
							break;
							
							// Key: 1
							case 49: location.href = '/card/deck.php?ano=0'; break;
							// Key: 2
							case 50: location.href = '/card/deck.php?ano=1'; break;
							// Key: 3
							case 51: location.href = '/card/deck.php?ano=2'; break;
							// Key: 4
							case 52: location.href = '/card/deck.php?ano=3'; break;
							// Key: 5
							case 53: location.href = '/card/deck.php?ano=4'; break;
							
							// Key: t1
							case 97: location.href = '/card/deck.php?ano=0'; break;
							// Key: t2
							case 98: location.href = '/card/deck.php?ano=1'; break;
							// Key: t3
							case 99: location.href = '/card/deck.php?ano=2'; break;
							// Key: t4
							case 100: location.href = '/card/deck.php?ano=3'; break;
							// Key: t5
							case 101: location.href = '/card/deck.php?ano=4'; break;
							
						}

					if( location.pathname == "/map.php") {
						switch (e.keyCode) {
							// Key: w
							case 87: $('#ig_cur01_w').click();
							break;
							// Key: s
							case 83: $('#ig_cur03_w').click();
							break;
							// Key: a
							case 65: $('#ig_cur04_w').click();
							break;
							// Key: d
							case 68: $('#ig_cur02_w').click();
							break;
						}
					}
					if( location.pathname == "/war/detail.php" ) {
						switch (e.keyCode) {
							// Key: w
							case 87: $('img[alt="戻る"]').click();
							break;
							// Key: a
							case 65: if( before_query ) { location.href = before_query; }
							break;
							// Key: d
							case 68: if( after_query ) { location.href = after_query; }
							break;
						}
					}
					if( location.pathname == "/war/list.php" ) {
						var plist = $('div.ig_battle_pagelist').find('li:has(span)');
						var plist_prev = plist.prev().find('a');
						var plist_next = plist.next().find('a');
						switch (e.keyCode) {
							// Key: w
							case 87: if( plist_prev.length ) { location.href = $('div.ig_battle_pagelist').find('a:first').attr('href'); }
							break;
							// Key: s
							case 83: if( plist_next.length ) { location.href = $('div.ig_battle_pagelist').find('a:last').attr('href'); }
							break;
							// Key: a
							case 65: if( plist_prev.length ){ location.href = plist_prev.attr('href'); }
							break;
							// Key: d
							case 68: if( plist_next.length ){ location.href = plist_next.attr('href'); }
							break;
						}
					}
					if( location.pathname == "/message/detail.php" || location.pathname == "/report/detail.php" ) {
					
						var lfa = $('div.ig_decksection_mid').find('.leftF > a' );
						var rfa = $('div.ig_decksection_mid').find('.rightF > a' );
						
						switch (e.keyCode) {
							// Key: w
							case 87: $('img[src$="btn_back.gif"]').click();
							break;
							// Key: a
							case 65: if( lfa.length ) { location.href = lfa.attr('href'); }
							break;
							// Key: d
							case 68: if( rfa.length ) { location.href = rfa.attr('href'); }
							break;
						}
					}
					if( location.pathname == "/card/deck.php" ||
					    location.pathname == "/union/levelup.php" ||
					    location.pathname == "/union/remove.php" ||
					    location.pathname == "/union/additional.php"
					) {
						var settop = $('#deck_file').find('#ig_decksection3').offset().top;
						if( location.pathname == "/card/deck.php" ) { settop = settop - 35; }
						
						switch (e.keyCode) {
							// Key: w
							case 87: $('html,body').animate( { scrollTop: settop }, 'fast' );
							break;
							// Key: s
							case 83: if( $('ul.pager').length ) { $('div.maisuu:eq(1)').click(); }
							break;
							// Key: a
							case 65: if( $('ul.pager').length ) { sp_prev.click(); }
							break;
							// Key: d
							case 68: if( $('ul.pager').length ) { sp_next.click(); }
							break;
						}
					}
					if( location.pathname == "/union/union_levelup.php" ) {
						switch (e.keyCode) {
							// Key: w
							case 87: $('html,body').animate( { scrollTop: $('table.common_table1:eq(0)').offset().top }, 'fast' );
							break;
						}
					}
					if( location.pathname == "/union/union_remove.php" ) {
						switch (e.keyCode) {
							// Key: w
							case 87: $('html,body').animate( { scrollTop: $('p.fs14').offset().top }, 'fast' );
							break;
						}
					}
					if( location.pathname == "/facility/set_unit_list.php" ) {
						switch (e.keyCode) {
							// Key: w
							case 87: $('html,body').animate( { scrollTop: $('#container').offset().top }, 'fast' );
							break;
							// Key: s
							case 83: $('html,body').animate( { scrollTop: $('#frame_00_mid').offset().top }, 'fast' );
							break;
							// Key: a
							case 65: if( $('ul.pager').length ) { sp_prev.click(); }
							break;
							// Key: d
							case 68: if( $('ul.pager').length ) { sp_next.click(); }
							break;
						}
					}
					else {
						switch (e.keyCode) {
							// Key: w
							case 87: if( sp_prev.length ) { location.href = $('ul.pager').find('a:first').attr('href'); }
							break;
							// Key: s
							case 83: if( sp_next.length ) { location.href = $('ul.pager').find('a:last').attr('href'); }
							break;
							// Key: a
							case 65: if( sp_prev.length ){ location.href = sp_prev.attr('href'); }
							break;
							// Key: d
							case 68: if( sp_next.length ){ location.href = sp_next.attr('href'); }
							break;
						}
					}
				});
			}

